import React,{useState} from "react";


export function Cards ({data}){
    const cards = data.cards
    // console.log(data.cards)
    console.log(cards)


    const returning = cards.map((card,index)=>{
        return (
            <div key ={index}>
                <div>
                    Card {index+1} of 2
                </div>
                <div>
                    {card.front}
                </div>
            </div>
        )
    })
    return returning
}
